import { ApolloExplorerReact } from '@apollo/explorer';
import './App.css';

function App() {

  return (
    <ApolloExplorerReact
      className='App'
      apolloStudioEnv='staging'
      graphRef='graph@current'
      endpointUrl='https://acephei-gateway.herokuapp.com'
    />
  );
}

export default App;
